import { Stack } from '@mui/material';
import { UsernameField, PasswordField, SubmitButton } from '../user';
import '../user.css';

export function Login() {
	return (
		<div className='center'>
			<Stack
				direction='column'
				spacing={2}
				component='form'
				p='24px'
				method='post'
				action='/users/login'
			>
				<UsernameField />
				<PasswordField label='Password' />
				<SubmitButton />
			</Stack>
		</div>
	);
}
